import insImages2 from "../../../../resouces/images/menuImages/specialty";

const Services = () => {
  const mergeImgs = [...insImages1, ...insImages2];
  return (
    <div>
      <h4>Instagram</h4>
      {
        mergeImgs.map(item => {
          return
            (
            <div className = "d-sm-flex">
            <Image src={item.src} thumbnail />
            </div>
            );
        })
      }

    </div >
